import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import '../styles/Forms.css'; // Import the CSS file

const RegisterForm = () => {
  const [formData, setFormData] = useState({
    first_name: '',
    last_name: '',
    username: '',
    pass_phrase: '',
    photo: null,
  });

  const [message, setMessage] = useState('');
  const [showLoading, setShowLoading] = useState(false); // State for showing loading popup
  const [showSuccessPopup, setShowSuccessPopup] = useState(false); // State for success popup
  const [successMessage, setSuccessMessage] = useState(''); // Success message
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleFileChange = (e) => {
    setFormData({
      ...formData,
      photo: e.target.files[0],
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setShowLoading(true); // Show loading popup

    const form = new FormData();
    form.append('first_name', formData.first_name);
    form.append('last_name', formData.last_name);
    form.append('username', formData.username);
    form.append('pass_phrase', formData.pass_phrase);
    if (formData.photo) {
      form.append('photo', formData.photo);
    }

    try {
      const response = await fetch('http://127.0.0.1:8000/register', {
        method: 'POST',
        body: form,
      });

      const text = await response.text();
      setMessage(text);

      if (response.ok) {
        setSuccessMessage(text); // Set the success message
        setShowSuccessPopup(true); // Show success popup
        setTimeout(() => {
          navigate('/login'); // Redirect to login page
        }, 2000); // Redirect after 2 seconds
      }
    } catch (error) {
      console.error('Error:', error);
      setMessage('An error occurred');
    } finally {
      setShowLoading(false); // Hide loading popup
    }
  };

  return (
    <>

      <div className="top-images-container">
        <img src="../../public/ensaj.png" alt="" />
        <div className="vertical-line"></div>
        <img src="../../public/3dsm.png" alt="" />
      </div>

    <div className='container'>
      <h2>Register</h2>
      <form onSubmit={handleSubmit}>
        <input
          type="text"
          name="first_name"
          placeholder="First Name"
          value={formData.first_name}
          onChange={handleChange}
          required
        />
        <input
          type="text"
          name="last_name"
          placeholder="Last Name"
          value={formData.last_name}
          onChange={handleChange}
          required
        />
        <input
          type="text"
          name="username"
          placeholder="Username"
          value={formData.username}
          onChange={handleChange}
          required
        />
        <input
          type="password"
          name="pass_phrase"
          placeholder="Pass Phrase"
          value={formData.pass_phrase}
          onChange={handleChange}
          required
        />
        <input type="file" name="photo" onChange={handleFileChange} />
        <button type="submit">Register</button>
      </form>
      <p>{message}</p>
      <p>
        Already have an account? <Link to="/login">Login here</Link>
      </p>

      {/* Loading Popup */}
      {showLoading && (
        <div className="loading-popup">
          <p>Processing, please wait...</p>
        </div>
      )}

      {/* Success Popup */}
      {showSuccessPopup && (
        <div className="message-popup">
          <p>{successMessage}</p>
          <button className="close-btn" onClick={() => setShowSuccessPopup(false)}>X</button>
        </div>
      )}
    </div>
    </>
  );
};

export default RegisterForm;
